import React from 'react';
import Tilt from 'react-parallax-tilt';
import prs from './Logo.png';
import './Logo.css';

const Logo = () => {
  return (
	  <Tilt>
      <div style={{ height: 150, width: 150, backgroundColor: 'darkgreen' }}>
        <h1><img src = {prs}/></h1>
      </div>
    </Tilt>
  );
}

export default Logo;
